import { combineReducers } from 'redux'
import {
    GET_DECK,
} from './Actions'

function cards(state = [], action) {
    console.log(GET_DECK);
    switch (action.type) {
        case GET_DECK:
            console.log("ddd")
            return state;
        default:
            return state
    }
}

const gameApp = combineReducers({
    cards
});

export default gameApp
